import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Welcome, на сайті для демонстрацій робіт!</h1>
      <p>Тут ви знайдете інформацію про мої лабораторні та практичні роботи.</p>
    </div>
  );
};

export default Home;
